Actionscript.script:
function 消弹()
{
	var 消弹属性 = _root.消弹属性初始化(this.攻击点);
	消弹属性.消弹方向 = _parent.方向 == "右" ? "左" : "右";
	消弹属性.Z轴攻击范围 = 30;
	消弹属性.区域定位area = this.攻击点;

	_root.消除子弹(消弹属性);
}

function 消弹()
{
	var 消弹属性 = _root.消弹属性初始化(this.攻击点);
	消弹属性.消弹方向 = _parent.方向 == "右" ? "左" : "右";
	消弹属性.Z轴攻击范围 = 30;
	消弹属性.区域定位area = this.攻击点;

	_root.消除子弹(消弹属性);
}

_parent.UpdateBigSmallState("普攻中","空手一段中");
function 攻击时移动(慢速度, 快速度)
{
	if (_parent.方向 == "右")
	{
		if (Key.isDown(_root.右键) == true)
		{
			_parent.移动("右",快速度);
		}
		else
		{
			_parent.移动("右",慢速度);
		}
	}
	else if (_parent.方向 == "左")
	{
		if (Key.isDown(_root.左键) == true)
		{
			_parent.移动("左",快速度);
		}
		else
		{
			_parent.移动("左",慢速度);
		}
	}
}

function 变招判定(招式名, 招式是否结束)
{
	if (_parent.操控编号 != -1 and _root.控制目标全自动 == false)
	{
		if (!_parent.飞行浮空 && _parent.动作B)
		{
			_parent.状态改变("空手跳");
		}
		else if (!_parent.飞行浮空 && Key.isDown(_root.键1))
		{
			_parent.状态改变("攻击模式切换");
		}
		else if (_parent.动作A && 招式名)
		{
			if (_parent.左行)
			{
				_parent.右行 = 0;
				_parent.方向改变("左");
			}
			else if (_parent.右行)
			{
				_parent.左行 = 0;
				_parent.方向改变("右");
			}
			gotoAndPlay(招式名);
		}
		else if (_parent.左行 || _parent.右行 || _parent.上行 || _parent.下行)
		{
			_parent.动画完毕();
		}
	}
	else if (招式名 && !招式是否结束)
	{
		gotoAndPlay(招式名);
	}
}

if(_parent.空手动作类型){
	帧名 = _parent.空手动作类型 + "1连招";
	gotoAndPlay(帧名);
}

onClipEvent(load){
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战子弹";
	子弹属性.子弹威力 =  _parent._parent.空手攻击力;
	if (_parent._parent.被动技能.拳脚攻击 && _parent._parent.被动技能.拳脚攻击.启用)
	{
		子弹属性.子弹威力 *= 1 + _parent._parent.被动技能.拳脚攻击.等级 * 0.1;
	}
	if(_parent._parent.mp攻击加成){
		子弹属性.子弹威力 += _parent._parent.mp攻击加成;
	}
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 10;

	子弹属性.水平击退速度 = 7;
	//非常用
	/*
	子弹属性.垂直击退速度 = NaN;
	子弹属性.发射效果 = "";
	子弹属性.击中地图效果 = "火花".
	子弹属性.击中后子弹的效果 = "".
	子弹属性.命中率 = NaN.
	子弹属性.固伤 = NaN;
	子弹属性.百分比伤害 = NaN;
	子弹属性.血量上限击溃 = NaN;
	子弹属性.防御粉碎 = NaN;
	*/
	子弹属性.区域定位area = this.area;
	/*
	//已初始化内容，通常不需要重复赋值，可注释掉
	子弹属性.发射者 = 子弹属性.发射者.
	子弹属性.shootX = 子弹属性.shootX;
	子弹属性.shootY = 子弹属性.shootY;
	子弹属性.shootZ = 子弹属性.shootZ;
	子弹属性.子弹敌我属性 = 子弹属性.子弹敌我属性;
	*/
	_root.子弹区域shoot传递(子弹属性);
}

